import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import LoginPage from './Page/LoginPage';
import MainPage from './Page/MainPage';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<LoginPage />} />
        <Route path="/main" element={<MainPage />} />
      </Routes>
    </Router>
  );
}

export default App;
